import React from 'react'

const input = () =>{
    const style={
        padding:"30px"
    };
    const input={
        padding:"0.5em",
        textalign:'center'
    };
    return(
        <div style={style}>
            <input type="text" style={input}></input>
        </div>
    )

}

export default input;
